import React from "react";
import "./Sidebar.css";

function Sidebar () {

  return (
    <div className="sidebar-box">
      <div className="logo">
        <img src="./images" alt="" />
        <h1>EcoBoard</h1>
      </div>
    </div>
  );

}

export default Sidebar;
